
SELECT MAX("member"."corp_no") as agg_0 FROM "provider" LEFT OUTER JOIN "region" ON "provider"."region_no" = "region"."region_no" LEFT OUTER JOIN "member" ON "region"."region_no" = "member"."region_no" LEFT OUTER JOIN "charge" ON "member"."member_no" = "charge"."member_no" LEFT OUTER JOIN "category" ON "charge"."category_no" = "category"."category_no"  WHERE "provider"."street" != '% %' AND "charge"."charge_no" >= 1024722 AND "category"."category_no" IS NOT NULL;